// Fetch registered devices from backend
async function fetchRegisteredDevices(setRegisteredDevices, setError) {
  try {
    const response = await api.get('/device/devices/registered');
    setRegisteredDevices(response.data);
  } catch (err) {
    setError('Failed to fetch registered devices: ' + (err.response?.data?.message || err.message));
  }
}

// TabPanel component definition
function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`admin-tabpanel-${index}`}
      aria-labelledby={`admin-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box sx={{ py: 3 }}>
          {children}
        </Box>
      )}
    </div>
  );
}

function AdminPanel() {
