  const [locationAccuracy, setLocationAccuracy] = useState(null); // Nominatim 'importance' proxy

  // Fetch location name from Nominatim when lat/lon change
  useEffect(() => {
    const fetchLocation = async () => {
      if (!latitude || !longitude) {
        setLocationName('');
        return;
      }
      try {
  const resp = await fetch(`https://nominatim.openstreetmap.org/reverse?format=jsonv2&lat=${latitude}&lon=${longitude}`);
  if (!resp.ok) throw new Error('Failed to fetch location');
  const data = await resp.json();
  setLocationName(data.display_name || 'Unknown location');
  setLocationAccuracy(data.importance || null); // importance is a float, higher = more important/accurate
      } catch {
        setLocationName('Unknown location');
      }
    };
    // Only fetch if both lat/lon are valid numbers
    if (!isNaN(Number(latitude)) && !isNaN(Number(longitude)) && latitude !== '' && longitude !== '') {
