      console.log('[SOCKET][device-status]', data); // Debug log
      if (data.deviceId && data.online) {
        onlineSet.add(data.deviceId);
      } else if (data.deviceId && data.online === false) {
        onlineSet.delete(data.deviceId);
      }
      setOnlineDevices(Array.from(onlineSet));
