            </Box>
          )}
          <Button variant="contained" color="primary" onClick={async () => {
            if (registeredDeviceIds.includes(deviceId)) {
              setError('This device ID is already registered.');
              return;
            }
            try {
              await api.post('/device/register', { deviceId, customName, latitude: latitude ? Number(latitude) : undefined, longitude: longitude ? Number(longitude) : undefined });
              setSuccess('Device registered successfully');
              fetchRegisteredDevices(setRegisteredDevices, setError);
            } catch (err) {
              setError('Failed to register device: ' + err.response?.data?.message);
            }
          }}>Register Device</Button>
        </Box>
        <Box sx={{ mt: 3 }}>
          <Typography variant="subtitle1">Registered Devices</Typography>
          <SortableTable columns={registeredDeviceColumns} data={registeredDevices} showPagination={false} />
        </Box>
      </TabPanel>
      {/* Add dialogs and other UI as needed */}
    </Box>
  );
}

export default AdminPanel;
